import React from 'react';
import './App.css';

import ScalpEth from './Components/ScalpEth';


import { useState } from 'react'

function App() {

    const [isToggleOn, setToggle] = useState(true)
    const [isToggleOnTwo, setToggleTwo] = useState(true)
    const [isToggleOnThree, setToggleThree] = useState(true)
    const [isToggleOnFour, setToggleFour] = useState(true)
    const [isToggleOnFive, setToggleFive] = useState(true)
    const [toggleTa, setToggleTa] = useState(true)

   const hanClick = () => {
        setToggle( isToggleOn  ? false : true)
      }

    const hanClickTwo = () => {
      setToggleTwo( isToggleOnTwo  ? false : true)
    }

    const hanClickThree = () => {
      setToggleThree( isToggleOnThree  ? false : true)
    }

    const hanClickFour = () => {
      setToggleFour( isToggleOnFour  ? false : true)
    }

    const hanClickFive = () => {
      setToggleFive( isToggleOnFive  ? false : true)
    }

    const hanClickTa = () => {
      setToggleTa( toggleTa  ? false : true)
    }

return (

<div className="App">
<div className="Navbar">

<a onClick={hanClickFour}>Scalping ETH</a>

</div >

{toggleTa ? false : <Ta/>}

{isToggleOnFour ? false : <ScalpEth/>}

</div>

);
}

export default App;
